var title_f41_28_42444="Weight based heparin nomogram";
var content_f41_28_42444=[" <div id=\"graphicsToolbar\">",
"  <div id=\"graphicsCopy\">",
"   &copy;2013 UpToDate",
"   <sup>",
"    &reg;",
"   </sup>",
"  </div>",
"  <div id=\"graphicsLinks\">",
"   <a href=\"?imageKey=PULM%2F58483&amp;source=image_view&amp;view=print&amp;elapsedTimeMs=1\" onclick=\"\">",
"    <img alt=\"Print this page\" src=\"./../images/icn_print.myextg\" title=\"Print this page\"/>",
"   </a>",
"   <a class=\"icontxt textLink\" href=\"?imageKey=PULM%2F58483&amp;source=image_view&amp;view=print&amp;elapsedTimeMs=1\" onclick=\"\" title=\"Print this page\">",
"    Print",
"   </a>",
"   <a class=\"etacLink\" href=\"#\">",
"    <img alt=\"Email graphic(s)\" src=\"./../images/icn_email.myextg\" title=\"Email graphic(s)\"/>",
"   </a>",
"   <a class=\"icontxt textLink etacLink\" href=\"#\" title=\"Email graphic(s)\">",
"    Email",
"   </a>",
"  </div>",
" </div>",
" <div class=\"graphic\">",
"  <div class=\"figure\">",
"   <div class=\"ttl\">",
"    Example of a weight-based nomogram for intravenous unfractionated heparin infusion for treatment of venous thromboembolism and/or pulmonary embolism",
"   </div>",
"   <div class=\"cntnt\">",
"    <table cellspacing=\"0\">",
"     <tbody>",
"      <tr>",
"       <td>",
"        Initial dose",
"       </td>",
"       <td colspan=\"2\">",
"        80 units/kg bolus, then 18 units/kg per hour*",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        <strong>",
"         aPTT result",
"        </strong>",
"       </td>",
"       <td>",
"        <strong>",
"         Action",
"        </strong>",
"       </td>",
"       <td>",
"        <strong>",
"         Next aPTT",
"        </strong>",
"        &nbsp;**",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        aPTT &lt;35 seconds (&lt;1.2 x control)",
"       </td>",
"       <td>",
"        80 units/kg bolus, then increase infusion rate by 4 units/kg per hour",
"       </td>",
"       <td>",
"        6 hours",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        aPTT 35 to 45 seconds (1.2 to 1.5 x control)",
"       </td>",
"       <td>",
"        40 units/kg bolus, then increase infusion rate by 2 units/kg per hour",
"       </td>",
"       <td>",
"        6 hours",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        aPTT 46 to 70 seconds",
"        <sup>",
"         &bull;",
"        </sup>",
"        (1.5 to 2.3 x control)",
"       </td>",
"       <td>",
"        No change (therapeutic range)",
"       </td>",
"       <td>",
"        6 hours (when two consecutive values are within therapeutic range, then next aPTT in morning)",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        aPTT 71 to 90 seconds (2.3 to 3.0 x control)",
"       </td>",
"       <td>",
"        Decrease infusion rate by 2 units/kg per hour",
"       </td>",
"       <td>",
"        6 hours",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        aPTT &gt;90 seconds (&gt;3.0 x control)",
"       </td>",
"       <td>",
"        Hold infusion 1 hour, then decrease infusion rate by 3 units/kg per hour",
"       </td>",
"       <td>",
"        6 hours",
"       </td>",
"      </tr>",
"     </tbody>",
"    </table>",
"   </div>",
"   <div class=\"lgnd\">",
"    <div class=\"footnotes\">",
"     aPTT: activated partial thromboplastin time.",
"     <br>",
"      <strong>",
"       This table is provided as an example of a locally developed and validated unfractionated heparin weight-based dose adjustment nomogram.&nbsp;",
"      </strong>",
"      It reflects the original aPTT ranges, bolus sizes, and suggested changes in infusion rate that were present at the time the study was performed.",
"      <sup>",
"       [1]",
"      </sup>",
"      The therapeutic ranges (ie, relationship between the aPTT and anti-factor Xa activity), initial and subsequent bolus sizes, and sizes of the infusion rate changes, as well as dosing differences depending on the disorder under treatment (eg, venous thromboembolism, stroke, acute coronary syndrome) should be established separately for each institution.",
"      <br>",
"       <sup>",
"        *",
"       </sup>",
"       Use of total body weight (TBW) is suggested for calculating the initial bolus dose and infusion rate for most obese patients.&nbsp; For additional information see &ldquo;Management of the critically ill obese patient&rdquo;, section &ldquo;Anticoagulants&rdquo;.",
"       <br>",
"        <sup>",
"         &nbsp;&bull;",
"        </sup>",
"        Therapeutic aPTT range of 46 to 70 seconds corresponded to anti-Xa activity of 0.3 to 0.7 units/mL. The target aPTT range in a particular institution should reflect what is known about the local reagents and equipment to perform the assay.",
"        <sup>",
"         [2]",
"         <br>",
"          **",
"         </br>",
"        </sup>",
"        The first aPTT should be obtained 4 to 6 hours after the initial heparin bolus.",
"       </br>",
"      </br>",
"     </br>",
"    </div>",
"    <div class=\"reference\">",
"     References:",
"     <br>",
"      1. Raschke RA, Reilly BM, Guidry JR, et al. The weight-based heparin dosing nomogram compared with a \"standard care\" nomogram. A randomized controlled trial. Ann Intern Med 1993; 119:874.",
"      <br>",
"       2.&nbsp;Garcia DA,&nbsp;Baglin TP,&nbsp;Weitz JI&nbsp;A, et al. Parenteral Anticoagulants: Antithrombotic therapy and Prevention of Thrombosis, American College of Chest Physicians Evidence-Based Clinical Practice Guidelines (9th Edition). Chest 2012; 141:e24S-e43S.",
"      </br>",
"     </br>",
"    </div>",
"   </div>",
"  </div>",
" </div>",
"</div>"].join("\n");
