" <div class=\"graphic\">",
"  <div class=\"figure\" style=\"width: 470px\">",
"   <div class=\"ttl\">",
"    CT-guided bone biopsy of a vertebral body in the cervical spine",
"   </div>",
"   <div class=\"cntnt\" style=\"width: 389px; height: 263px; background-image: url(data:image/jpeg;base64,);\">",
"   </div>",
"   <div class=\"lgnd\">",
"    This myeloma was associated with complete destruction of the C7 vertebral body. The use of CT to guide the bone biopsy permits accurate placement of the biopsy needle, avoiding the carotic sheath and the spinal canal.",
"    <div class=\"footnotes\">",
"    </div>",
"    <div class=\"reference\">",
"     Courtesy of Daniel Rosenthal, MD.",
"    </div>",
